{let e=function(){let e=$("#new-search-form");e.submit((function(n){n.preventDefault(),$.ajax({type:"post",url:"/search",data:e.serialize(),success:function(e){for(i of($("#Search-container>ul").empty(),e.data.result)){let e=r(i);$("#Search-container>ul").prepend(e)}},error:function(e){console.log(e.responseText)}})}))},r=function(e){return e.avatar?$(`<li>\n                      <p>\n                        <img src="${e.avatar}" style="width: 25px; height: 25px; border-radius: 4px;">  \n                        <a href="/users/profile/${e._id}" style="color: black;">${e.name}</a> \n                      </p>\n                  </li>  \n            `):$(`<li>\n                      <p>\n                        <i class="fas fa-user-friends"  style="font-size: 20px; border-radius: 4px;"></i>\n                        <a href="/users/profile/${e._id}" style="color: black;">${e.name}</a> \n                      </p>\n                  </li>  \n            `)};e()}